app.controller("unavaitime",["$scope","unavaiTimeAPIService","dialogService","$timeout",function(n,t,i,r){function u(){t.getUnavaiTimes().then(function(t){n.unavaiTimes=t.data})}n.unavaiTimes=[];n.unavaiTime={};n.title="不可预约时间";n.routeName="home";n.submit=function(){t.createUnavaiTime(n.unavaiTime).then(function(){n.unavaiTime.startTime="";n.unavaiTime.endTime="";i.showMention(1,"不可预约时间添加成功");r(u,200)})};u();n.deleteUnavaiTime=function(i){t.deleteUnavaiTime(i.unavaiId).then(function(){n.unavaiTimes.splice(n.unavaiTimes.indexOf(i),1)})}}]);